import React from 'react';

interface Props {
  todo: Array<Todo>;
  input: Number;
}

export const TodoListItem:React.FC<Props> = ({ todo, input }) => {
	const checkList: any = todo.filter(obj => { return obj.month === input })
  return <ul>{todo.map(todo => <li>
<input type='checkbox' />{todo.text}
</li>)} 
  {input}
  {checkList}
</ul> 
};
